import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";

import React from "react";
import Dashboard from "../screens/dashboar"

function Routing(props) {
  return (
    <div>
        <Router>

      <Routes>
  
         <Route path="/dashboard" element ={<Dashboard />}/>
      </Routes>
        </Router>
    </div>
  );
}

export default Routing;
